        fullStatement:
          'When a dual-text set contains one literary and one informational text, the literary text (text #1) is the primary focus, and the set of items must include items from the literary stimulus as well as items written across both texts. The informational text (text #2) must only be used as a foundational piece for the literary text, and no items can be written for only the informational text. If both texts are literary, items may be written to either or both. All dual-text stimuli sets should contain between 25-40% items written across both texts. \r\n\r\nWhen developing items from dual-text, Task Model 5 (short text constructed response-WR) should be written using the Appropriate Stems for Dual-Text Stimuli only to ensure students will have the opportunity to respond in writing to information from both texts.  Between 25-40% of all other items written in the dual-text set should be written across both texts. \r\n\r\nThe title of the each text should be included in the stem when more than one text is used.  Dual-text is considered long text.',
