        educationLevel: ['03'],
        fullStatement:
          'Students will be required to read brief narrative texts (one to three paragraphs) and write one or more paragraphs. Students with physical impairments may need to use an adapted mouse or a computer with eye scanning capabilities. Students who are visually impaired or blind may need to have visual media described to them. Other formats or supports may be necessary for students with other disabilities. Speech-to-text may be an appropriate accommodation for students who have difficulty writing. The accommodations listed here are suggestions and could be altered depending on what accommodations will be allowable.',
