        fullStatement:
          'The **stem** will pose a question about a revision to the stimulus that improves some specified (underlined) aspect of the text’s development or organization. **Answer choices** will present more than four options of similar structure. The **correct answers** will be clearly discernible and best solutions that revise the stimulus to make the indicated improvements. (For revision stems should **not** ask for correct answers, but should ask for best answers in relation to audience, purpose, and task.) No more than half the choices should be correct responses. \r\n\r\n**Note:** Text included in brackets [ ] in the following task model item stems indicates possible alternative wording. When constructing questions, be sure to select only one wording option; do not include the additional options in brackets.\r\n\r\n**Note:** Items for this target must have a setup that states audience, purpose (narrative), and context/task.\r\n\r\n**Note:** Items aligned to organization present details that are out of order **NOT** details which do not belong. Elaboration items address details that do not belong.\r\n\r\n*(**Note**: In this automated version of the item specification, underlined text appears in italics.)*',
