          '**Note:** All stimuli/stems should indicate that students are revising a **draft** for a specified reason.\r\n\r\n*(**Note**: In this automated version of the item specification, underlined text appears in italics.)*\r\n\r\n**ORGANIZATION ITEM STEMS**\r\n\r\nA student is writing a [story, etc.] about \\_____ for [the teacher, the class, etc.]. The student wants to **revise** the draft to organize it better. Read the draft of the \\_____ and [answer the question/complete the task] that follows. [Insert text.]\r\n\r\n-   [Embed short narrative with a missing or inappropriate beginning] Choose the **best** beginning sentence to [start the story, introduce the (setting, characters, problem, etc.) OR to replace the first sentence] .\r\n\r\n-   [Embed short narrative with a missing or inappropriate ending] The story has no ending. Choose the **best** ending sentence for the \\_____.\r\n\r\n**ELABORATION ITEM STEMS**\r\n\r\nA student is writing a [story] for [the teacher, the class, etc.] about \\_____ . The student wants to **revise** the draft to improve the development of ideas. Read the draft of the \\_____ and [answer the question/complete the task] that follows. [Insert text.]\r\n\r\n-   Choose the **best** sentence to add [before/after *the underlined sentence* or *underlined part when \\_____*] to show [or explain] who the main character is [or what is going on, or what the conflict is, or how the character feels about \\_____, etc.].\r\n\r\n-   Choose the **best** descriptive sentences [or lines of dialogue] to replace [or to be added after] [*underlined* text] to show [or explain] who the main character is [or what is going on, or what the conflict is, or how the character feels about \\_____ etc.].\r\n\r\n-   The writer wants to add dialogue to the story to make it more [descriptive, exciting, etc.]. Which sentence would **best** replace [*underlined* text] [or to come before/after *underlined* text, etc.] to show [or explain] who the main character is [or what is going on, or what the conflict is, or how the character feels about \\_____, etc.].\r\n\r\n**Note:** Stem must indicate specifically where the information is to be inserted. This can be by *underlining* a section and indicating, for example, “[the underlined part] between paragraphs 1 and 2 [or between the part when \\_____ and \\_____]” or “after [the underlined part] at the end of paragraph 3,” etc.',
        abbreviatedStatement: 'Appropriate Stems'
