          '**Note:** All stimuli/stems should indicate that students are revising a **draft** for a specified reason.\r\n\r\n*(**Note**: In this automated version of the item specification, underlined text appears in italics.)*\r\n\r\n**ORGANIZATION ITEM STEMS**\r\n\r\nA student is writing a [story] about \\_____ for [the teacher, the class, etc.]. Read the draft of the \\_____ and complete the task that follows. [Insert text.]\r\n\r\n-   Write a beginning\\* that shows what is going on at the start of the story and/or explains who the characters are.\r\n\r\n-   Write an ending\\* for the story that solves [or finishes the story by solving] the problem in the story. [**Note:** Since this item type is tagged as “organization,” be sure that ONLY an ending—resolution to the “problem”—is needed.]\r\n\r\n\\* Be sure that stimulus clearly ***needs*** a beginning/ending.\r\n\r\n**ELABORATION ITEM STEMS**\r\n\r\nA student is writing a [story] about \\_____ for [the teacher, the class, etc.]. Read the draft of the \\_____ and complete the task that follows. [Insert text.]\r\n\r\n[Insert stimulus text between 150-200 words]\r\n\r\n**Note**: Elaboration items should ask for development ***within*** the existing text. The requested elaboration should come at key points in the story to further develop the conflict, the characters, the turning point, etc.\r\n\r\nA student is writing a \\_____ for \\_____ about \\_____. The student wants to make the story more [exciting or interesting, etc.].\r\n\r\n-   Add [dialogue and/or description] to replace [the underlined part of the story] to show [what happens when \\_____  OR what happens between two characters or events, etc.]\r\n\r\n-   Add [dialogue and/or description] after the underlined part of the story, to show what happens [when \\_____ OR at the part when \\_____, etc.].\r\n\r\n**Note\\*:** Stem must **always** indicate specifically where the information is to be inserted. This can be by *underlining* a section and indicating, for example, “[the underlined part] between paragraphs 1 and 2” or “after [the underlined part] at the end of paragraph 3,” etc., or by asking students to complete a paragraph/section that has been started (and underlined) for them.',
