        educationLevel: ['03', '04', '05'],
        fullStatement:
          '-   The student provides a numeric answer to a problem where the context requires them to go beyond the result of a single computation.\r\n\r\n-   The student may be asked to choose a value that falls into a range of acceptable values limited by information given in a real-world context.\r\n\r\n-   The student may be asked to round up or round down based on the constraints of the context.\r\n\r\n-   The student may be asked to interpret the meaning of mathematical computations, for example, the different interpretations of arithmetic operations.\r\n\r\n-   The student may be asked to interpret the meaning of points on the number line or in the coordinate plane in a real-world context.\r\n\r\n-   The student may be asked to solve a problem that requires the integration of concepts and skills from multiple domains.\r\n\r\n-   Difficulty of the task may be adjusted by varying (a) the difficulty of extracting information from the context (b) the number of steps (c) the complexity of the numbers used or (d) the complexity of the interpretation required.\r\n\r\n-   Tasks have DOK Level 1 or 2.',
        abbreviatedStatement: '2C General Task Model Expectations'
