        fullStatement:
          'Target 2D identifies a key step in the modeling cycle, and is thus frequently present in problems with real-world contexts. Note that Target 2D is rarely the primary target for an item, but is frequently a Secondary or Tertiary Target for an item with primary alignment to 2A, 2B, or 2C. See Items 1, 3, 4, and 5 in Task Model 1a, Item 1 in Task model 1d, and Items 2 and 3 in Task model 2a for examples that draw upon the skill set described in Target 2D.\r\n\r\n**General Task Model Expectations for Target 2D**\r\n\r\n-   The student is presented with a mathematical problem in a real-world context where the quantities of interest are not named explicitly, are named but represented in different ways, or the relationship between the quantities is not immediately clear.\r\n\r\n-   The student is asked to solve a problem that may require the integration of concepts and skills from multiple domains.',
