        educationLevel: ['09', '10', '11', '12'],
        fullStatement:
          'Ways to vary this item to increase or decrease its complexity include (a) presenting the conversion from quarts to cubic inches in a less direct manner, e.g., by giving the dimensions of a cylindrical quart measure, or by saying that a certain number of quarts completely fills another vessel with different dimensions, or (b) varying the shape of the vessel, e.g., by making it a circular cake pan or a conical sieve. When the geometric work to be done is more complex, the item might fall more naturally within Task Model 2A.5. The difficulty can also be varied by varying the numerical complexity of the dimensions, but care should be taken not to do so in a way that merely increases the computational complexity. For example, if the dimensions are given as two-digit decimals, a calculator should be provided, since the target is problem solving, not computation. On the other hand, changing the dimensions to 7.5 x 10 x 2, with the expectation that students who look for structure will see that the 2 x 7.5 = 15 and 10 x 15 = 150, is a valid increase in the problem-solving demand of the task. Any version of this task would require students to identify quantities of interest and to map the relationship between them, and so draws on the skill set identified in Target 2D.',
