        educationLevel: ['09', '10', '11', '12'],
        fullStatement:
          '(Source: Adapted from Illustrative Mathematics 8.EE Quinoa Pasta 1)\r\n\r\nA type of pasta is made of two ingredients, quinoa and corn. The pasta company is not disclosing the amount of each ingredient in the pasta, but we know that the quinoa in the pasta contains 16.2% protein, and the corn in the pasta contains 3.5% protein. Overall, each 57 gram serving of pasta contains a total of 4 grams of protein.\r\n\r\nHow many grams of quinoa and how many grams of corn is in one serving of the pasta?\r\n\r\nEnter the number of grams of quinoa in the first response box, Enter the number of grams of corn in the second response box. Round each amount to the nearest gram.\r\n\r\nQuinoa: $\\Box$\r\nCorn: $\\Box$',
