        fullStatement:
          '- The student creates an equation in two variables or builds a function to represent a relationship in a mathematical or real-world context and uses the equation or function to answer a question about the context, by evaluating the function at one or more inputs or recognizing and using some feature of the function or its graph (such as the fact that the values are always positive, or that the graph is linear with a negative slope).\r\n\r\n- Some items in this task model should reward looking for and making use of structure. For example, the student should select the form of the expression that defines the function that is appropriate for the purpose of the task.\r\n\r\n- Dimensions along which to vary the task include (a) varying the context, (b) naming the independent or dependent variables (easier) or expecting the student to identify the quantities of interest and choose variables to represent them (harder), (c) varying the type of function built (linear, quadratic, exponential, power, or a combination of these), (d) naming (easier) or not naming (harder) the type of function to be used, or giving an explicit form for it (easiest), or (e) varying the difficulty of extracting the function from the context given (quite difficult in this case).',
