        fullStatement:
          '*P*(*x*) represents the cost that an online bookstore charges for shipping items and packaging material that\r\ntogether weigh *x* pounds. The packaging material weighs 1 pound.\r\n\r\nA competitor charges the same rate per pound but does not charge for the weight of the packaging material. However, the competitor does charge an additional $5 processing fee for each shipment.\r\n\r\nWhich expression represents the cost of shipping *x* pounds with the competitor?\r\n\r\nA. *P*(*x* + 5) + 1\r\nB. *P*(*x* + 5) − 1\r\nC. *P*(*x* + 1) + 5\r\nD. *P*(*x* − 1) + 5',
